import React from 'react'
import { ProjectsData } from './Data'
import { projectNav } from './Data'

function Works() {
  return (
   <div className="work_filters">
    {
projectNav.map((item,index)=>{
    return (
        <span className="work_item" key={index}>{item.name}</span>
    )
})
    }
   </div>

   .work_con
  )
}

export default Works
